import React,{ Component } from 'react';

import './App.css';


class App extends Component{
  constructor() {
    super();
    this.state = {
     monsters: [
       {
         name : 'Satish',
         id : '11'
       },
       {
        name : 'Sonu',
        id : '12'
      },
      {
        name : 'Shreyansh',
        id : '13'
      },
      {
        name : 'Ashok',
        id : '14'
      },
      {
        name : 'Vani',
        id : '15'
      }
     ]
    }
  }

  componentDidMount(){
    fetch('https://jsonplaceholder.typicode.com/user').then(response=>console.log(response));
  }
  render(){



    return (

          <div className="App">
            {this.state.monsters.map(monster => <h1 key={monster.id}>{monster.name}</h1>)}
          </div>
        );
      }

}

export default App;
